import React from "react";
import './style.css';
import { StudyProgressRateItem } from "../../types";

//              interface: 스터디 진행률 아이템 컴포넌트 Props               //
interface Props {
    studyProgressRateItem: StudyProgressRateItem;
}

//              component: 스터디 진행률 아이템 컴포넌트             //
export default function StudyProgressRateInfoItem({ studyProgressRateItem }: Props) {

    //              state: Properties               //
    const { studyStartDate, studyEndDate, progressDate, totalDate } = studyProgressRateItem;

    //              render: 스터디 진행률 아이템 컴포넌트 렌더링             //
    return (
        <div>
            <div className="studyStartDate">{studyStartDate}</div>
            <div className="studyEndDate">{studyEndDate}</div>
            <div className="progressDate">{progressDate}</div>
            <div className="totalDate">{totalDate}</div>
        </div>
    );
}
